        var lt2 = {}
        for (j in word) {
          if (!fits) continue;
          if (typeof(lt2[word[j]]) == 'undefined') {
            lt2[word[j]] = 1;
          } else {
            lt2[word[j]] += 1;
          }
          if (typeof(lt[word[j]]) == 'undefined' ||
              lt2[word[j]] > lt[word[j]]) {
            fits = false;
          }
        }
        if (fits) out.push(word);
      }
      return out;
    }

    window.onload = function() {
      var letters = document.querySelector('input[name="letters"]');
      var mask = document.querySelector('input[name="mask"]');
      var out = document.querySelector('#result');

      function updateResult() {
        var length = document.querySelector('input[name="length"]:checked');
        if (length == null)
          return;
        length = Number(length.value);
        out.innerHTML = findword(length, letters.value, mask.value).join(', ');
      }
      letters.addEventListener('input', updateResult);
      mask.addEventListener('input', updateResult);
      var radios = document.querySelectorAll('input[type="radio"]');
      for (var i=0; i < radios.length; i++) {
        radios[i].addEventListener('change', updateResult);
      }
    };
 </script>
</body>
